import React, { useState, useEffect, useCallback } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import { useAuth } from "../../context/AuthContext";

function StudentConsultations() {
  const { logout } = useAuth();
  const [consultations, setConsultations] = useState([]);
  const [selectedConsultation, setSelectedConsultation] = useState(null);
  const [newConsultation, setNewConsultation] = useState({ topic: "", description: "" });
  const navigate = useNavigate();

  // ✅ Fetch consultations
  const fetchConsultations = useCallback(async () => {
    try {
      const storedUser = localStorage.getItem("user");
      if (!storedUser) {
        alert("You are not logged in!");
        navigate("/login");
        return;
      }
      const { token } = JSON.parse(storedUser);
      const res = await axios.get("http://localhost:5000/consultations/student", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setConsultations(res.data);
    } catch (error) {
      console.error("Failed to fetch consultations:", error);
      alert("Error fetching consultations. Please try again.");
    }
  }, [navigate]);

  useEffect(() => {
    fetchConsultations();
  }, [fetchConsultations]);

  // ✅ Open Edit Modal
  const openModal = (consultation) => {
    setSelectedConsultation(consultation);
    setNewConsultation({ topic: consultation.topic, description: consultation.description });
    const modal = new window.bootstrap.Modal(document.getElementById("editModal"));
    modal.show();
  };

  // ✅ Handle input change
  const handleInputChange = (e) => {
    setNewConsultation({ ...newConsultation, [e.target.name]: e.target.value });
  };

  // ✅ Save changes
  const handleSave = async () => {
    try {
      const storedUser = localStorage.getItem("user");
      if (!storedUser) {
        alert("User not authenticated!");
        return;
      }
      const { token } = JSON.parse(storedUser);
      await axios.put(
        `http://localhost:5000/consultations/update/${selectedConsultation._id}`,
        newConsultation,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      alert("Consultation updated successfully!");
      fetchConsultations();
      const modal = window.bootstrap.Modal.getInstance(document.getElementById("editModal"));
      modal.hide();
    } catch (error) {
      console.error("Error saving consultation:", error);
      alert("Failed to save consultation. Try again!");
    }
  };

  return (
    <div className="container mt-5">
      <h2>Your Consultations</h2>
      <ul className="list-group">
        {consultations.map((consultation) => (
          <li key={consultation._id} className="list-group-item">
            <strong>{consultation.topic}</strong> - {consultation.status}
            <button className="btn btn-warning btn-sm float-end" onClick={() => openModal(consultation)}>
              Edit
            </button>
          </li>
        ))}
      </ul>

      {/* ✅ Bootstrap Modal for Editing Consultation */}
      <div className="modal fade" id="editModal" tabIndex="-1" aria-hidden="true">
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title">Edit Consultation</h5>
              <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>
            <div className="modal-body">
              <label className="form-label">Topic:</label>
              <input
                type="text"
                name="topic"
                value={newConsultation.topic}
                onChange={handleInputChange}
                className="form-control"
              />
              <label className="form-label mt-2">Description:</label>
              <textarea
                name="description"
                value={newConsultation.description}
                onChange={handleInputChange}
                className="form-control"
              ></textarea>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">
                Cancel
              </button>
              <button type="button" className="btn btn-success" onClick={handleSave}>
                Save Changes
              </button>
            </div>
          </div>
        </div>
      </div>

    </div>
  );
}

export default StudentConsultations;
